import "./App.css";
import axios from "axios";
import React, { useEffect, useState } from "react";
import Button from "./UI/Button";
import Card from "./UI/Card";

function App() {
  const [vehicles, setVehicles] = useState([]);

  const getVehicles = async () => {
    const { data } = await axios("/vehicles/list");
    console.log("data!!!!!!!!",data);
    setVehicles(data);
  };
  const occupyVehicle = async() => {
    // const { ifOccupy } = await axios.post("/vehicle/2/occupy");
    // console.log("occupy Vehicle",ifOccupy);

  };
  const releaseVehicle = () => {
    console.log("release Vehicle");
    // axios.get()
  };

  const renderVehicles = (_vehicles) => {
    return _vehicles.map((v) => {
      return (
        <div className="vehicles-wrapper">
          <Card>
            <div>
              <p>
                <span style="fontWeight: bold;">
                  manufacturer:
                </span>
                {v.manufacturer}
              </p>
              <p>
                <span style="fontWeight: bold;">
                  license plate number: 
                </span>
                {v.license_plate_number}
              </p>
            </div>

            <div className="buttons-wrapper">
              {/* {console.log("pppp", v.is_available, v.manufacturer)} */}
              {console.log("pppp",v.owner)}
              {/* if available=true  Occupy button will showen  */}
              {/* if available=false && user is owner - Release will showen */}
              <div className="occupy-wrapper">
                <Button
                  className={
                    "button " + (v.is_available ? "available" : "not-available")
                  }
                  onClick={occupyVehicle}
                >
                  Occupy
                </Button>

                <span
                  className={
                    !v.is_available ? "not-available-text" : "text-disable"
                  }
                >
                  Vehicle is not available
                </span>
              </div>
              <div className="release-wrapper">
                <Button
                  className={
                    "button " + (v.is_available ? "available-and-owner" : "")
                  }
                  onClick={releaseVehicle}
                >
                  Release
                </Button>
              </div>
            </div>
          </Card>
        </div>
      );
    });
  };

  useEffect(() => {
    getVehicles();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h2>Vehicles list </h2>
      </header>
      {renderVehicles(vehicles)}
    </div>
  );
}

export default App;
